%[text] ## Problem 1. Data Collapse for Laminar Pipe Flow (Buckingham-$\\Pi$)
%[text] In practice, fluid flow in pipes is commonly encountered in systems. For example, the flow of liquid propellants through the network of ducts and lines found in a rocket engine.
%[text] "In fully developed laminar flow, each fluid particle moves at a constant axial velocity along a streamline and the velocity profile *u(r)* remains unchanged in the flow direction." \[1\] See Fig. 8-11.
imshow('Fig8-11_LaminarFlow.png') %[output:650c514e]
%[text] - \[*Newtonian fluid* - viscosity is constant; shear stress is proportional to shear rate.\] \
%[text] Why aerospace engineers care about the Newtonian assumption:
%[text:table]
%[text] | **Area** | **Newtonian assumption works** | **Non-Newtonian risk** |
%[text] | --- | --- | --- |
%[text] | Aerodynamics | ✔ External flow | ✖ Icing fluids, contaminants |
%[text] | Propulsion | ✔ Gas dynamics | ✖ Slurries, gels |
%[text] | Thermal | ✔ Convective models | ✖ Phase-changing coatings |
%[text] | CFD | ✔ Standard solvers | ✖ Needs constitutive modeling |
%[text:table]
