%[text] ### 1. Raw plot
%% HW2 Problem 1 — Raw plot: Δp vs Q grouped by constant (D, mu, rho, L)
% 1) Reads pipe_lab.csv
% 2) Plots one curve per unique set of (D, mu, rho, L)

clear; clc; close all;

%% ---- 1) Read the raw data file ----
% Assumes pipe_lab.csv is in the current folder. Otherwise, set full path here:
fname = "pipe_lab.csv";
T = readtable(fname);

% Expected columns (per HW PDF):
% D_mm, mu_mPa_s, rho_kg_m3, L_m, Q_mL_s, dp_kPa
% If your file has different headers, adjust these names accordingly.
D   = T{:,2};  % [mm]
mu  = T{:,3};  % [mPa*s]
rho = T{:,4};  % [kg/m^3]
L   = T{:,5};  % [m]
Q   = T{:,6};  % [mL/s]
dp  = T{:,7};  % [kPa]

%% ---- 2) Group by constant parameters and plot Q vs Δp ----
% If any of these are floating with tiny roundoff, rounding makes grouping robust.
Dg   = round(D,   6);
mug  = round(mu,  6);
rhog = round(rho, 6);
Lg   = round(L,   6);
%%
G = findgroups(Dg, mug, rhog, Lg); % Assign group numbers
nG = max(G); % Total number of unique groups
%%
%fig = figure('Color','w','Visible', 'off');
fig = figure('Color','w'); %[output:5073d9a1]
fig.Theme = "light"; %[output:5073d9a1]
hold on; grid on; box on; %[output:5073d9a1]

% Plot each group as its own curve
for k = 1:nG
    idx = (G == k);

    % Sort by Q so curves don't zig-zag
    [Qk, order] = sort(Q(idx));
    dpk = dp(idx);
    dpk = dpk(order);

    plot(Qk, dpk, '-o', 'LineWidth', 1.4, 'MarkerSize', 5); %[output:5073d9a1]
end

xlabel('Q [mL/s]'); %[output:5073d9a1]
ylabel('\Delta p [kPa]'); %[output:5073d9a1]
t = title('\Delta p vs Q (grouped by constant D, \mu, \rho, L)'); %[output:5073d9a1]
t.Units = 'normalized'; %[output:5073d9a1]
t.Position(2) = 1.00; %[output:5073d9a1]
t.Position(1) = 3.00; %[output:5073d9a1]

% Build a readable legend label for each curve
labels = strings(nG,1);
for k = 1:nG
    idx = (G == k);
    % pull representative values from first row in group
    i0 = find(idx, 1, 'first');
    labels(k) = sprintf('D=%.3g mm, \\mu=%.3g mPa·s, \\rho=%.3g kg/m^3, L=%.3g m', ...
        D(i0), mu(i0), rho(i0), L(i0));
end
legend(labels, 'Location', 'bestoutside'); %[output:5073d9a1]
