%[text] ### 2. Buckingham $\\Pi$ analysis
%[text] <u>Step 1</u>:
%[text] Pressure drop:
%[text] $\\Delta p = f(Q, D, L, \\mu, \\rho) \\rightarrow n = 6$
%[text] **Note: Only one dependent parameter is analyzed here,** $\\Delta p$; also, it is assumed that this dependent parameter is a function of volumetric flow rate, $Q$. 
%[text] 
%[text] <u>Step 2</u>:
%[text:table]
%[text] | **Parameter** | $\\Delta p$ | $Q$ | $D$ | $L$ | $\\mu$ | $\\rho$ |
%[text] | --- | --- | --- | --- | --- | --- | --- |
%[text] | Primary dimensions | $M^1L^{-1}T^{-2}$ | $L^3T^{-1}$ | $L^1$ | $L^1$ | $M^1L^{-1}T^{-1}$ | $M^1L^{-3}$ |
%[text:table]
%[text] 
%[text] <u>Step 3</u>:
%[text] As an initial guess, set the reduction $j$ as the number of primary dimensions --
%[text] $j = 3$
%[text] #### (a) Dimensionless Groups Expected
%[text] If this initial guess is *correct*, the number of $\\Pi$'s, or dimensionless groups expected is $k$:
%[text] $k = n - j = 6 - 3 = \\mathbf{3}$
%%
%[text] <u>Step 4</u>:
%[text] Choose $j$ repeating parameters --
%[text] - **Hint of the day:** A *wise* choice of repeating parameters for most fluid flow problems is a **length**, a **velocity**, and a **mass** or **density**. \
% Call the 'buckinghamPi' sub-routine;
% it computes the Buckingham Pi groups (one set for 1 dependent variable) 
% based off the input of repeating parameters.

params = ["dP", "Q", "D", "L", "mu", "rho"];
%depParams = ["dP", "Q"];
dimNames = ["M", "L", "T"];
%%
% Dimensions:M  L  T    % Parameters:
dimMatrix = [1 -1 -2;   % dP
             0  3 -1;   % Q
             0  1  0;   % D
             0  1  0;   % L
             1 -1 -1;   % mu
             1 -3  0];  % rho
%%
results = buckinghamPi(params, dimNames, dimMatrix); %[output:7c8a0e1a] %[output:357cc935] %[output:3b0c6d86] %[output:96ac995d] %[output:4fc789b6] %[output:7c3cc891] %[output:7dd18a35] %[output:1c11a6a6] %[output:9d0fcc73] %[output:81c4efde] %[output:4dbe87e7] %[output:81121477]
disp(results.exponents); %[output:775f97d2]
disp(results.piGroups); %[output:5506e104]
%%
%[text] #### (b) $\\Pi$ Groups
%[text] <u>Step 5</u>:
%[text] Construct $k \\space \\Pi$'s, and manipulate as necessary.
clipboard('copy', latex(results.piGroups))
%%
%[text] \\left(\\begin{array}{ccc} \\frac{D^4\\,\\mathrm{dP}}{Q^2\\,\\rho } & \\frac{L}{D} & \\frac{D\\,\\mu }{Q\\,\\rho } \\end{array}\\right)
%[text] 
%[text] $\\Pi\_1 = \\left( \\frac{D^4\\,\\mathrm{\\Delta P}}{Q^2\\,\\rho } \\right)$                (5-1)
%[text] $\\Pi\_2 = \\left( \\frac{D\\,\\mu }{Q\\,\\rho } \\right)$                    (5-2)
%[text] $\\Pi\_3 = \\left( \\frac{L}{D} \\right)$                       (5-3)
%[text] 
%[text] #### (c) Rewrite in Terms of Mean Speed
%[text] Solve for Q: 
%[text] $Q = \\frac{ \\pi D^2 U }{ 4 }$                        (5-4)
%[text] Sub (5-4) into (5-1):
%[text] $\\Pi\_{1, modified} = \\frac{16} {\\pi^2} \\frac{\\Delta P}{\\rho U^2}$            (5-5)
%[text] $\\Pi\_{2, modified} = \\frac{4} {\\pi} \\frac{1} {Re}$                (5-6)
%%
%[text] <u>Step 6</u>:
%[text] Write the functional relationship
%[text] $\\Delta P = f(f, AR)$
%[text] $\\Pi\_1 = \\Phi \\left( \\Pi\_2, \\Pi\_3 \\right)$ 
%[text] $\\frac{\\Delta P}{\\rho U^2} = \\Phi \\left(Re, \\frac{L}{D} \\right)$                (5-7)
%[text] - Note: The pure dimensionless constants are omitted from the functional relationship; they're "absorbed" into the function $\\Phi$. \
%[text] <u>**Discussion**</u>
%[text] This functional relationship unveils the physics -- the physical parameters -- that govern laminar pipe flow; pressure drop is a function of **dynamic pressure** ($\\rho U^2 / 2$), the **Reynolds number**, and the geometry's aspect ratio ($L/D$).
%%
%[text] ### 3. Variables that Collapse the Data
%[text] $\\textbf{plot \\textit{f} - vs - \\textit{Re} \\space on log-log axes}$
%[text] Plot *f* vs *Re* on log-log axes
%% HW1 Problem 1.3 — Compute (f, Re) for each run and plot f vs Re (log-log)

clear; clc; close all;

% Read data (pipe_lab.csv)
T = readtable("pipe_lab.csv");

% Columns:
D_mm    = T{:,2};   % [mm]
mu_mPas = T{:,3};   % [mPa*s]
rho     = T{:,4};   % [kg/m^3]
L       = T{:,5};   % [m]
Q_mLs   = T{:,6};   % [mL/s]
dp_kPa  = T{:,7};   % [kPa]

%% Unit conversions to SI (as required)
D  = D_mm * 1e-3;        % [m]
mu = mu_mPas * 1e-3;     % [Pa*s]
Q  = Q_mLs * 1e-6;       % [m^3/s]
dp = dp_kPa * 1e3;       % [Pa]

%% Mean speed
U = 4*Q ./ (pi*D.^2);    % [m/s]

%% Reynolds number and Darcy friction factor
Re = (rho .* U .* D) ./ mu;
f  = (2*dp .* D) ./ (rho .* U.^2 .* L);   % same as dp / ((L/D)*(rho U^2/2))

%% Plot collapse: f vs Re (log-log)
fig = figure('Color','w'); %[output:7a446049]
fig.Theme = "light"; %[output:7a446049]
loglog(Re, f, 'o', 'MarkerSize', 6, 'LineWidth', 1.2); %[output:7a446049]
grid on; box on; %[output:7a446049]
xlabel('Re'); %[output:7a446049]
ylabel('Darcy friction factor, f'); %[output:7a446049]
title('Data collapse: f vs Re'); %[output:7a446049]

% Optional: label some points or color by diameter/viscosity later if you want
%[text] <u>Discussion</u>
%[text] The *f* -vs- *Re* plot shows that data from different diameters, viscosities, and densities collapse onto a single curve, indicating the **Reynolds number** and the **Darcy friction factor** captures the relevant physics governing laminar pipe flow.
%%
%[text] ### 4. Compare to Laminar Theory
%[text] %[text:anchor:TMP_9d12]  For fully developed laminar pipe flow, theory predicts:
%[text] $f = \\frac{64}{Re}$
%% Overlay laminar theory: f = 64 / Re
hold on; %[output:4da8b8f1]

Re_th = logspace(log10(min(Re)), log10(max(Re)), 300);
f_th  = 64 ./ Re_th;

loglog(Re_th, f_th, 'k--', 'LineWidth', 2); %[output:4da8b8f1]

legend('Experimental data', 'Laminar theory: f = 64 / Re', ... %[output:group:0b5e99dd] %[output:4da8b8f1]
    'Location', 'best'); %[output:group:0b5e99dd] %[output:4da8b8f1]
%[text] <u>Discussion</u>
%[text] The experimental data clearly shows **agreement** to the laminar theory ($f = 64/Re$). The experimental friction factor data collapse well onto the theoretical laminar prediction, indicating fully developed laminar flow and validating the nondimensionalization.
%%
%[text] ### 5. Inference - "Effective" Viscosity
%[text] For laminar flow \[1\]:
%[text] $\\Delta P = \\frac{32 \\mu L U}{D^2}$ $\\rightarrow \\mu\_{fit} = \\frac{\\Delta P D^2} {32 L U} \\quad (1)$
%[text] Or, equivalently, as in practice it is convenient to express the pressure loss for all types of fully developed internal flows as \[1\]:
%[text] $\\Delta P = f \\frac{L}{D} \\frac{\\rho U^2}{2} \\quad (2)$
%[text] Substituting (2) into (1) gives:
%[text] $\\mu\_{fit} = \\frac{f \\rho D}{64} \\quad (3)$
%% Problem 1.5 — Estimate mu_fit and compare to tabulated mu

% --- mu_fit per run (Poiseuille / fRe=64) ---
mu_fit = (dp .* D.^2) ./ (32 .* U .* L);    % [Pa*s]

% Tabulated mu is already in SI (Pa*s) from your conversion earlier: mu

% --- Percent error per run ---
pct_err = 100 * (mu_fit - mu) ./ mu;

% --- Put per-run results into a table (optional but helpful) ---
T_out = table(D, L, rho, mu, mu_fit, pct_err, Re, f, ...
    'VariableNames', {'D_m','L_m','rho','mu_tab_Pa_s','mu_fit_Pa_s','pct_err','Re','f'});

disp("Per-run viscosity fit summary (all runs):"); %[output:92fc25e4]
disp(T_out(1:min(36,height(T_out)), :)); %[output:6d0e8456]

% --- Aggregate by "fluid condition"
% Usually viscosity condition is identified by (mu_tab, rho); you can add D and/or L if needed.
G = findgroups(mu, rho);  % group by tabulated mu and density

mu_tab_group = splitapply(@mean, mu, G);
rho_group    = splitapply(@mean, rho, G);

mu_fit_mean  = splitapply(@mean, mu_fit, G);
mu_fit_std   = splitapply(@std,  mu_fit, G);

N_group      = splitapply(@numel, mu_fit, G);

pct_err_mean = 100 * (mu_fit_mean - mu_tab_group) ./ mu_tab_group;

T_group = table(mu_tab_group, rho_group, N_group, mu_fit_mean, mu_fit_std, pct_err_mean, ...
    'VariableNames', {'mu_tab_Pa_s','rho','N','mu_fit_mean_Pa_s','mu_fit_std_Pa_s','pct_err_mean'});

disp("Grouped by (mu_tab, rho):"); %[output:91acd318]
disp(T_group); %[output:2c0e8fe7]

% --- Quick visual compare (optional)
fig = figure('Color','w'); hold on; box on; grid on; %[output:5259ae02]
fig.Theme = "light"; %[output:5259ae02]
plot(mu, mu_fit, 'o', 'LineWidth', 1.2); %[output:5259ae02]
xline = linspace(min(mu), max(mu), 100);
plot(xline, xline, 'k--', 'LineWidth', 1.5); % y=x perfect agreement %[output:5259ae02]
xlabel('\mu_{tab} [Pa·s]'); %[output:5259ae02]
ylabel('\mu_{fit} [Pa·s]'); %[output:5259ae02]
title('Viscosity: fitted vs tabulated'); %[output:5259ae02]
legend('Runs','y=x','Location','best'); %[output:5259ae02]
%%
%[text] <u>Discussion</u>
%[text] The 'Per-run viscosity fit summary' table shows the effective viscosity to be within 0.001 up to 6.70 % of the tabulated viscosity, indicating **agreement** between to the dimensionalization process, and the fluid conditions of the experimental runs being in a fully-developed laminar flow regime - as assumed. :)
